import React from 'react';
import axios from 'axios';

export default class SystemList extends React.Component {
  inp;
  res;
  componentDidMount() {
    axios.get(`https://new.vyatsu.ru/sveden/common`)
        .then(res => {
            const systems = res.data;
            this.inp = res.data;
            this.setState({systems});
            
        })
        
        
  }
  findAddresses() {
    let input = this.inp;
    const regex = /\d{6},/ //\w+ \w+, г. \w+, \w+. \w+, \w. \d{1,2,3}\d\S+/;
    let results = [];
    let match;
    while ((match = regex.exec(input))) {
      results.push(match);
    }
    return results;
  }
  render() {
    return (
      <div> 
        <button onClick={this.findAddresses} >Показать</button>
          {this.inp}
          {this.res}
          
      </div>
    )
  }
}
